const Comment = (props) => {


    return (
        
          
            <div class="card">
            <div >
                <div class="card" >
                    <h2 class="card-header">{props.comment.usernick}  <h6><small>{props.comment.timeOfCreation}</small></h6></h2>
                    <div class="card-body">
                        <h6 class="card-title">{props.comment.text}</h6>
                        </div>
</div>
</div>

        </div>
    );
}

export default Comment
